//import logo from './logo.svg';
import sun from './sun.png';
import './App.css';

let pi = 3.14;
let radius = 696340;

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={sun} alt="logo" />
        <p>
          Current known value of Pi : {pi}
        </p>
        <p>
          The circumference of the Sun: {2*pi*radius}
        </p>
      </header>
    </div>
  );
}

export default App;
